import React,{Component} from 'react';
import Person from './persons'

function NameList(){
	const persons = [
		'Diana',
		'Bruce']
		return (
			<div>
                 persons.map((person) => <h1>{person}</h1>)
            </div>
			)
}	
export default NameList
